import './App.css';
import React from 'react';

function MyComponent(){
  const element = <h1>hello, JSX</h1>
  const link = <a href=''>Example link</a>
  return <>
    <div>
      <h1>Hello, React</h1>,
      {element},
      {link}
    </div>
    </>;
}

export default MyComponent;
